import React from 'react';

const Range = (props) => (
  <div className="range">
    <span> {props.label}: {props.value}</span>
    <input
      type="range" min="1" value={props.imdb} max={props.max}
      onChange={props.handleChange}
      name={props.name}
    />
    <datalist id="steplist">
      <option>0</option>
      <option>25</option>
      <option>50</option>
      <option>75</option>
      <option>100</option>
    </datalist>

  </div>
);

export default Range;
